            <p>
                大众网东营6月27日讯（通讯员 张学荣）6月23日，山东（河口）风电产业园首批机组下线既二期项目开工仪式在河口经济开发区隆重举行，标志着河口经济开发区在实施新旧动能转换重大工程中又迈出了可喜的一步。山东（河口）风电产业园建设将对加快东营新旧动能转换，推动海洋经济深度融合发展具有现实意义和深远影响。
                东营市是我国海上风电的战略要地，河口地处黄蓝经济区前沿，拥有丰富的生态资源和优势，2017年7月，市政府、河口区政府与中车永济电机有限公司、中国三峡新能源有限公司、新疆金风科技股份有限公司签署《战略合作协议》后。合作各方作为风电行业的龙头企业充分发挥各自优势，坚持高起点规划、高标准建设山东（河口）风电产业园，打通海陆风电全产业链，共同打造东营海上风电装备制造基地。中车永济电机有限公司、中国三峡新能源股份有限公司、新疆金风科技股份有限公司相继在河口注册成立了西安中车永电捷力风能有限公司山东分公司、三峡新能源东营发电有限公司和山东金风科技股份有限公司，利用原华锐风电闲置厂房和未利用土地，合作建设山东（河口）风电产业园。
                中车永济电机有限公司深耕风电产业20余年，以雄厚的技术研发和制造实力为全球市场和客户提供最先进、更高效的产品和服务。其产品分布全国1000多个风电场，覆盖目前在运行风力发电机的23%，其中直驱永磁发电机占国内市场份额近40%。随着“一带一路”和“中国制造2025”等国家战略的顺利实施，中车永济电机有限公司坚持以打造风电行业标杆企业为目标，积极推进“两海战略”实现，以更高品质的风电产品将山东（河口）风电产业园努力打造成为国内一流、国际领先的风电装备研发、制造和出口基地，为中国中车“金名片”增光添彩，为中国风电走向全球提供永电方案、贡献永电智慧。
                中国三峡新能源有限公司主要从事风能等清洁可再生能源领域的投资、开发于运营，并致力于成为海上风电引领者，目前海上风电业务分布广发，并获取超过1000万千瓦海上风电资源。新疆金风科技股份有限公司代表着全球风力发电领域最具成长前景的技术路线，是全");
            WriteLiteral(@"球最大的直驱永磁风机研制企业。
                山东（河口）风电产业园占地304亩，计划总投资15亿元，由中车永济电机有限公司、新疆金风科技股份有限公司及中国三峡新能源有限公司共同投资建设。项目分两期建设完成。目前，项目一期兆瓦级直驱电机生产线已投产运营，定子生产线已动工，计划今年下半年投产运营；二期主要建设机舱叶轮生产线及其它风电配套设备并最终完成总装。项目整体竣工后，将具备年产1000台定子、600台整机及机舱叶轮等装备生产能力，预计可实现年产值超50亿元。
            </p>

